import { Container, Col, Row } from "reactstrap";

// import axios from "axios";
// const apiKey = "1006fef0a3b86d3192ae766835bf6dc3"
import Mapbox from "./components/Mapbox"


function App() {
  return (
    <Container fluid={true}>
      <Row>
        <Col>
          <Navbar />

        </Col>
      </Row>
      <Row>
        {/* <Col> */}
          <Mapbox />
          <Cards className="border"/>
        {/* </Col> */}

      </Row>
    </Container>

  );
}

export default App;
